syntax = "proto3";

message QA_Market_order{
    float price=1;
    string date=2;
    string datetime=3;
    string sending_time=4;
    string transact_time=5;
    float amount=6;
    int64 towards=7;
    string code=8;
    string user=9;
    string strategy=10;
    string type=11;
    string order_model=12;
    string amount_model=13;
    string order_id=14;
    string trade_id=15;
    string status=16;

}